var id_cnpj=document.getElementById("id_cnpj");id_cnpj.addEventListener("blur",e=>{consultaCNPJ(id_cnpj.value).then(e=>{document.getElementById("id_name").value=e.nome,document.getElementById("id_name_fantasy").value=e.fantasia,document.getElementById("id_company_size").value=e.porte,document.getElementById("id_company_legal_nature").value=e.natureza_juridica,document.getElementById("id_company_situation").value=e.situacao},e=>{console.log("ERRO:",e)})});var id_address_cep=document.getElementById("id_address_cep");id_address_cep.addEventListener("blur",e=>{consultaCEP(id_address_cep.value).then(e=>{document.getElementById("id_address").value=e.logradouro,document.getElementById("id_address_neighborhood").value=e.bairro,document.getElementById("id_address_neighborhood").value=e.bairro,document.getElementById("id_address_number").focus()},e=>{console.log("ERRO:",e)})});
